import React, { useEffect, useState } from 'react';
import axios from 'axios';


function HandleCommision(props) {
    console.log(props);
    const [product, setProduct] = useState([]);

    const getCommision = async () => {
        try {
            const res = await axios.get(`/products/${props}`);
            const jsonData = await res.data;
            console.log(jsonData);
            setProduct(jsonData);
            let prod = product.map((pro) => {
                commision = pro.commisionPercentage;
                price = pro.purchasePrice;
                commisionGained += price / commision;
                console.log(commisionGained);
            })
            return (commisionGained);
        } catch (err) {
            console.error(err);
        }
    }

    useEffect(() =>{
        getCommision();
    }, []);



    let prod = product.map((pro) => {
        commision = pro.commisionPercentage;
        price = pro.purchasePrice;
        commisionGained += price / commision;
        console.log(commisionGained);
    })

    return (
        <th scope="row" className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap">
            {commisionGained}
        </th>
    )
}
export default HandleCommision;
